        const cats = [];
        cats[0] = new Cat("left", 3.4, "50%");
        cats[1] = new Cat("right", 7.4, "50% - 50px");
        cats[2] = new Cat("left", 5.4, "50% + 50px");
        cats[3] = new Cat("right", 9.4, "50% - 100px");
        cats[4] = new Cat("left", 8.4, "50% + 100px");
        cats[5] = new Cat("right", 4.4, "50% - 150px");
        cats[6] = new Cat("left", 6.4, "50% - 200px");

        const animation = () => {
          sound.play();
          cats.forEach((cat) => cat.animate());
          setTimeout(() => {
            iam.style.transform = "scale(2)";
            setTimeout(() => {
              iam.style.transition = "all .3s";
              iam.style.transform = "scale(1)";
              iamappear.play();
              setTimeout(() => {
                (mainContainer.style.opacity = 0),
                  setTimeout(() => {
                    mainContainer.remove();
                  }, 2000);
              }, 2000);
            }, 1000);
          }, 16000);
        };
        mainContainer.append(iam);

        if (document.documentElement.clientWidth <= 768) {
          let time;
          let bomb = [];

          const observerFooter = new IntersectionObserver(() => {
            if (bomb.length === 0) {
              bomb.push("first");
              console.log(bomb);

              time = setTimeout(() => {
                bomb = [];
                console.log("DEFUSED", bomb);
              }, 7000);
            } else if (bomb[1] === "second" && bomb.length === 2) {
              bomb.push("third");
              console.log(bomb);
            }
          });
          const observerHeader = new IntersectionObserver(() => {
            if (bomb[0] === "first" && bomb.length === 1) {
              bomb.push("second");
              console.log(bomb);
            } else if (bomb[2] === "third" && bomb.length === 3) {
              clearTimeout(time);
              bomb = "EXPLODE";
              startMobileAnimation();
              console.log("SUCCESS");
            }
          });

          function startMobileAnimation() {
            mainContainer.style.pointerEvents = "all";
            mainContainer.style.backgroundColor = "#24B861cc";
            mainContainer.style.zIndex = 1000000;
            mainContainer.addEventListener("click", animka);

            function animka() {
              mainContainer.style.backgroundColor = "transparent";
              animation();
              mainContainer.removeEventListener("click", animka);
            }
          }

          const footer = document.querySelector(".footer");
          const header = document.querySelector(".main-page-banner h2");

          observerFooter.observe(footer);
          observerHeader.observe(header);
        } else {
          const sequence = [
            "ArrowLeft",
            "ArrowRight",
            "ArrowLeft",
            "ArrowRight",
            "ArrowUp",
            "ArrowDown",
          ];
          let counter = 0;
          function checkKeys(e) {
            if (e.key === sequence[counter]) {
              counter++;
              if (counter === sequence.length) {
                animation();
                document.body.removeEventListener("keydown", checkKeys);
              }
            } else {
              counter = 0;
            }
          }
          document.body.addEventListener("keydown", checkKeys);
        }
      });
    </script>
